webpackJsonp([1258],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-introducing-javascript-object-notation-json.json":function(o,a){o.exports={data:{markdownRemark:{html:'<p>JavaScript Object Notation or <code>JSON</code> uses the format of JavaScript Objects to store data. JSON is flexible because it allows for <code>Data Structures</code> with arbitrary combinations of <code>strings</code>, <code>numbers</code>, <code>booleans</code>, <code>arrays</code>, and <code>objects</code>.</p>\n<p>Here is an example of a JSON object:</p>\n<pre><code>var ourMusic = [\n  {\n    "artist": "Daft Punk",\n    "title": "Homework",\n    "release_year": 1997,\n    "formats": [ \n      "CD", \n      "Cassette", \n      "LP" ],\n    "gold": true\n  }\n];\n</code></pre>\n<p>This is an array of objects and the object has various pieces of <code>metadata</code> about an album. It also has a nested <code>formats</code> array. Additional album records could be added to the top level array.</p>',frontmatter:{title:"Introducing javaScript Object Notation Json",parent:"/home/stuart/guides/src/pages/articles/javascript/introducing-javascript-object-notation-json/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/introducing-javascript-object-notation-json/"}}}});
